webpackJsonp([36929557758694],{340:function(e,a){e.exports={pathContext:{posts:[{html:"<h4>por Mario Benedetti</h4>\n<p>Se me ocurre que vas a llegar distinta <br/>\nno exactamente más linda <br/>\nni más fuerte <br/>\nni más dócil <br/>\nni más cauta <br/>\ntan solo que vas a llegar distinta <br/>\ncomo si esta temporada de no verme <br/>\nte hubiera sorprendido a vos también <br/>\nquizá porque sabes <br/>\ncómo te pienso y te enumero <br/></p>\n<p>Después de todo la nostalgia existe <br/>\naunque no lloremos en los andenes fantasmales <br/>\nni sobre las almohadas de candor <br/>\nni bajo el cielo opaco <br/></p>\n<p>Yo nostalgio <br/>\ntu nostalgias <br/>\ny cómo me revienta que él nostalgie <br/></p>\n<p>Tu rostro es la vanguardia <br/>\ntal vez llega primero <br/>\nporque lo pinto en las paredes <br/>\ncon trazos invisibles y seguros <br/></p>\n<p>No olvides que tu rostro <br/>\nme mira como pueblo <br/>\nsonríe y rabia y canta <br/>\ncomo pueblo <br/>\ny eso te da una lumbre <br/>\ninapagable <br/>\nahora no tengo dudas <br/>\nvas a llegar distinta y con señales <br/>\ncon nuevas <br/>\ncon hondura <br/>\ncon franqueza <br/></p>\n<p>Sé que voy a quererte sin preguntas. <br/>\nSé que vas a quererme sin respuestas.</p>",id:"/Users/fernandomendoza/Proyectos/my-blog/src/pages/2017-12-11-bienvenida-mario-benedetti/index.md absPath of file >>> MarkdownRemark",frontmatter:{date:"2017-12-12T03:33:49+00:00",path:"/bienvenida-mario-benedetti",title:"Bienvenida",excerpt:"Se me ocurre que vas a llegar distinta",tags:["poema","mario benedetti","poeta latinoamericano"]}}],tagName:"poeta latinoamericano"}}}});
